-- tạo hệ số 1,-1,0  dựa trên amount

create table subpublic.oracle_ar006_doanhthu as select * from oracle_ar006_doanhthu 
drop table subpublic.oracle_ar006_doanhthu

drop table subpublic.oracle_ar006_doanhthu
select * from subpublic.oracle_ar006_doanhthu where doanh_thu <>0
drop view oracle_ar006_doanhthu
create view oracle_ar006_doanhthu as

select * from da_ar006
where gl_date >'2023-01-01'and gl_date < '2023-06-30'
		and (business_unit = 'THUANHAI_THC' or business_unit ='THUANHAI_VN')


select * from oracle_ar006_doanhthu where he_so_sl = 0
drop view oracle_ar006_doanhthu
create view oracle_ar006_doanhthu as
with cte as (
select 
		a.id,
		a.message_main_attachment_id,
		a.business_unit,
		a.source,
		a.transaction_type,
		a.customer_number,
		a.customer_name,
		a.transaction_number,
		a.sales_order,
		a.transaction_date,
		a.payment_term,
		a.gl_date,
		a.due_date,
		a.comments,
		a.print_option,
		a.so_lines,
		a.header_context_value,
		a.hdct,
		a.action,
		a.transfer,
		a.form,
		a.seri,
		a.vat_number,
		a.vat_number_thay_the,
		a.method,
		a.so_tk,
		a.so_huu,
		a.ngan_hang_mo,
		a.lai_suat,
		a.ngan_hang_cam_co,
		a.hop_dong,
		a.so_tk_tat_toan_cam_co,
		a.warehouse_name,
		a.item_code,
		a.line_description,
		a.uom,
		a.quantity,
		a.price,
		a.amount,
		a.tax_code,
		a.tax_amount,
		a.line_amount,
		a.currency,
		a.exchange_rate_type,
		a.exchange_rate,
		a.revenue_account,
		a.receivables_account,
		case 
			when amount > 0 then 1
			else -1
		end as he_so_sl
from da_ar006 as a
where (gl_date between '2023-01-01'and '2023-06-30')
		and (business_unit = 'THUANHAI_THC' or business_unit ='THUANHAI_VN')
			)
	select 
		a.id,
		a.message_main_attachment_id,
		a.business_unit,
		a.source,
		a.transaction_type,
		a.customer_number,
		a.customer_name,
		a.transaction_number,
		a.sales_order,
		a.transaction_date,
		a.payment_term,
		a.gl_date,
		a.due_date,
		a.comments,
		a.print_option,
		a.so_lines,
		a.header_context_value,
		a.hdct,
		a.action,
		a.transfer,
		a.form,
		a.seri,
		a.vat_number,
		a.vat_number_thay_the,
		a.method,
		a.so_tk,
		a.so_huu,
		a.ngan_hang_mo,
		a.lai_suat,
		a.ngan_hang_cam_co,
		a.hop_dong,
		a.so_tk_tat_toan_cam_co,
		a.warehouse_name,
		a.item_code,
		a.line_description,
		a.uom,
		a.quantity,
		a.price,
		a.amount,
		a.tax_code,
		a.tax_amount,
		a.line_amount,
		a.currency,
		a.exchange_rate_type,
		a.exchange_rate,
		a.revenue_account,
		a.receivables_account,
		CASE WHEN a.line_description like '%Điều chỉnh%' or  a.line_description like '%Điều chỉnh%' THEN 0
			ELSE a.he_so_sl
			END as he_so_sl,
		c.loai_bh,
		c.loai_hinh,
		CASE WHEN a.gl_date = a.due_date THEN 'Đúng Kỳ'
			ELSE 'Lệch Kỳ' 
		End as ky_kd,
		CASE WHEN a.line_description LIKE 'THAN ĐÁ%' then 'Than đá'
			 WHEN a.line_description LIKE 'TRẤU%' then 'Trấu'
			Else 'Khác'
		End as loai,
		CASE WHEN a.customer_name = 'CÔNG TY CỔ PHẦN THUẬN HẢI ENERGY' then 'Nội bộ'
			Else 'Bán Ngoài'
		End as loai_KH,
		CASE when a.revenue_account like '%.511%' or a.revenue_account like '%.521%' then 1
			ELSE 0
		END as he_so_dthu,
		CASE WHEN a.currency <> 'VND' THEN 
			CASE WHEN a.revenue_account like '%.511%' or a.revenue_account like '%.521%' then 1
			ELSE 0
		END * a.amount * exchange_rate::float
       		ELSE CASE WHEN a.revenue_account like '%.511%' or a.revenue_account like '%.521%' then 1
			ELSE 0
		END * a.amount * 1
    	END AS doanh_thu
	from cte as a
	left join subpublic.da_dim_dmtk_erp_n1 as c 
	on a.revenue_account = c.revenue_account
	and a. receivables_account = c.receivables_account



